import React from 'react';
import { Link } from 'react-router-dom';
import { Navigation } from "../navigation";

const userHomeContainerStyle = {
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  height: '100vh',
  backgroundColor: '#1beebd',
  color: '#fff',
};

const homeContentStyle = {
  textAlign: 'center',
  maxWidth: '600px',
  padding: '20px',
  borderRadius: '10px',
  boxShadow: '0 0 160px rgba(255, 0, 0, 0.5)',
  backgroundColor: '#007bff',
};

const headingStyle = {
  fontSize: '28px',
  marginBottom: '15px',
};

const paragraphStyle = {
  fontSize: '16px',
  marginBottom: '10px',
};

const buttonStyle = {
  backgroundColor: '#fff',
  color: '#007bff',
  padding: '12px 20px',
  border: 'none',
  borderRadius: '5px',
  cursor: 'pointer',
  fontSize: '16px',
  textDecoration: 'none',
};

const Userhome = () => {
  return (
    <><Navigation /><div className="d1">

      </div><div style={userHomeContainerStyle}>
              <div style={homeContentStyle}>
                  <h1 style={headingStyle}>Welcome to XYZ Hospital</h1>
                  <p style={paragraphStyle}>
                      Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut rhoncus
                      risus eget dapibus facilisis.
                  </p>
                  <p style={paragraphStyle}>
                      In this hospital, we strive to provide the best healthcare services
                      to our patients.
                  </p>
                  <Link to="/Userbook" style={{ textDecoration: 'none' }}>
                      <button style={buttonStyle}>Go to User Book</button>
                  </Link>
              </div>
          </div></>
  );
};

export default Userhome;
